const { parseInputs } = require("./parsing");
const { InlineFile } = require("./File");
import { test, expect } from "vitest";

test("simple test", async () => {
  const params = {
    number: 123,
    string: "String value",
    nullable: null,
  };

  const parsedParams = parseInputs(params);
  expect(parsedParams).toEqual({
    number: 123,
    string: "String value",
    nullable: null,
  });
});

test("simple image test", async () => {
  const params = {
    file: {
      __typename: "InlineFile",
      dataURL:
        "data:image/png;name=cover.png;base64,",
    },
  };

  const file = InlineFile.fromDataURL(
    "data:image/png;name=cover.png;base64,"
  );

  const parsedParams = parseInputs(params);
  expect(parsedParams).toEqual({
    file: file,
  });
});

test("dataURL image test", async () => {
  const params = {
    file: {
      __typename: "InlineFile",
      dataURL:
        "data:image/png;name=cover.png;base64,",
    },
    otherData: "other",
  };

  const parsedParams = parseInputs(params);
  expect(parsedParams).toEqual({
    otherData: "other",
    file: InlineFile.fromDataURL(
      `data:image/png;name=cover.png;base64,`
    ),
  });
});

test("nested image test", async () => {
  const params = {
    post: {
      file: {
        __typename: "InlineFile",
        dataURL:
          "data:image/png;name=cover.png;base64,",
      },
      id: 123,
    },
    otherData: "someOtherValue",
    deepNest: {
      deeperNested: {
        deeperNestedImage: {
          __typename: "InlineFile",
          dataURL:
            "data:image/png;name=cover.png;base64,",
        },
        otherDeeperNestedValue: true,
      },
      deepNestedImage: {
        __typename: "InlineFile",
        dataURL:
          "data:image/png;name=cover.png;base64,",
      },
    },
  };

  const parsedParams = parseInputs(params);
  expect(parsedParams).toEqual({
    post: {
      id: 123,
      file: InlineFile.fromDataURL(
        "data:image/png;name=cover.png;base64,"
      ),
    },
    otherData: "someOtherValue",
    deepNest: {
      deeperNested: {
        deeperNestedImage: InlineFile.fromDataURL(
          "data:image/png;name=cover.png;base64,"
        ),
        otherDeeperNestedValue: true,
      },
      deepNestedImage: InlineFile.fromDataURL(
        "data:image/png;name=cover.png;base64,"
      ),
    },
  });
});

test("nested structure", async () => {
  const params = {
    names: ["james", "susan"],
    ages: [1, 2],
    things: [
      {
        type: "type",
        file: {
          __typename: "InlineFile",
          dataURL:
            "data:image/png;name=cover.png;base64,",
        },
        names: ["james", "susan"],
      },
    ],
  };

  const parsedParams = parseInputs(params);
  expect(parsedParams).toEqual({
    names: ["james", "susan"],
    ages: [1, 2],
    things: [
      {
        type: "type",
        file: InlineFile.fromDataURL(
          "data:image/png;name=cover.png;base64,"
        ),
        names: ["james", "susan"],
      },
    ],
  });
});
